import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark px-3 app-navbar">
      <Link className="navbar-brand d-flex align-items-center" to="/">
        <img src="/brand-logo.svg" alt="Logo" className="me-2 brand-logo" />
        <span>Employee Leave Tracker</span>
      </Link>
      <div className="collapse navbar-collapse">
        <ul className="navbar-nav ms-auto">
          <li className="nav-item">
            <Link className="nav-link" to="/">Employees</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/leaves">Leave Requests</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
